import React, {
    Component
} from 'react'
import axios from 'axios';

class Data extends Component {


    constructor(props) {
        super(props);
        this.state = {
            imageURL: '',
            numerot: [],
        }
    }

    componentDidMount() {
        axios.get('https://dog.ceo/api/breeds/image/random')
            .then(response => {
                this.setState({
                    imageURL: response.data.message
                });
            })
      //  axios.get('https://jsonplaceholder.typicode.com/todos?_limit=10')
        //    .then(res => this.setState({ numerot: res.data }))

        axios.get('https://jsonplaceholder.typicode.com/todos?_limit=10')
            .then(res => this.setState({ numerot: res.data }))

            .catch(error => {
                console.log(error);
            });
    }
    //koiria
   // <img alt="123" src={imageURL} />
    render() {
        const { imageURL } = this.state;
        return ( 
            <div >
                <img alt="123" src={imageURL} />
                <ol>
                    {this.state.numerot.map(reptile => <li>{reptile}</li>)}
                </ol>

            </div>
        )
    }
}

export default Data
